css:
@-moz-document domain("developer.mozilla.org") {
	a {
		color: #fcb454;
	}
	code {
		color: black;
	}
	#content {
		background-color: #645e5e;
	}
	.cta-link,
	summary {
		color: #fffc05;
	}
	.text-content .learn-box,
	.note {
		background-color: #d4fffa;
	}
	#wikiArticle {
		color: #00e669;
	}
	#wiki-document-head {
		background-color: #a67a3f;
	}
	#main-header {
		background-color: grey;
	}
	#wiki-document-head {
		visibility: hidden;
		padding: 0;
	}
}
